/*Table structure for table `t_home_page_info` */

DROP TABLE IF EXISTS `t_home_page_info`;

CREATE TABLE `t_home_page_info` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `TITLE1` varchar(16) NOT NULL COMMENT '标题1',
  `CONTENT1` text COMMENT '内容1',
  `TITLE2` varchar(16) NOT NULL COMMENT '标题2',
  `CONTENT2` text COMMENT '内容2',
  `TITLE3` varchar(16) NOT NULL COMMENT '标题3',
  `CONTENT3` text COMMENT '内容3',
  `TITLE4` varchar(16) NOT NULL COMMENT '标题4',
  `CONTENT4` text COMMENT '内容4',
  `CREATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATE_BY` int(11) DEFAULT NULL COMMENT '创建人',
  `UPDATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `UPDATE_BY` int(11) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='信息表';

/*Data for the table `t_home_page_info` */

/*Table structure for table `t_nurse_plan` */

DROP TABLE IF EXISTS `t_nurse_plan`;

CREATE TABLE `t_nurse_plan` (
  `NURSE_PLAN_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '服务方案编号',
  `CUSTOM_ID` int(11) DEFAULT NULL COMMENT '客户主键',
  `BACKEND_PERSON_ID` int(11) DEFAULT NULL COMMENT '后台用户主键',
  `NURSE_PLAN_CONTENT` text COMMENT '服务方案内容',
  `NURSE_PLAN_TITLE` varchar(100) DEFAULT NULL COMMENT '服务方案标题',
  `NURSE_PLAN_BEGIN_DATE` date DEFAULT NULL COMMENT '方案开始日期\r\n',
  `NURSE_PLAN_TYPE` tinyint(4) DEFAULT NULL COMMENT '服务方案 1:生活助理 2:老龄照护 3:临床护理',
  `NURSE_PLAN_STATUS` tinyint(4) DEFAULT NULL COMMENT '方案状态(0:草稿 1:发布)',
  `USE_TYPE` tinyint(4) DEFAULT NULL COMMENT '使用状态 0:启动 1：停用',
  `DRAFT_DATE` datetime DEFAULT NULL COMMENT '制定日期',
  `CREATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATE_BY` int(11) DEFAULT NULL COMMENT '创建人',
  `UPDATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `UPDATE_BY` int(11) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`NURSE_PLAN_ID`) USING BTREE,
  KEY `FK_客户与护理方案关系` (`CUSTOM_ID`) USING BTREE,
  KEY `FK_服务人员_客户与护理计划关系` (`BACKEND_PERSON_ID`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=283 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='服务方案表';

/*Data for the table `t_nurse_plan` */

/*Table structure for table `t_operator_log` */

DROP TABLE IF EXISTS `t_operator_log`;

CREATE TABLE `t_operator_log` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `MODULE` varchar(1024) DEFAULT NULL COMMENT '模块名称',
  `METHOD` varchar(1024) DEFAULT NULL COMMENT '方法名称',
  `STATUS_DESC` varchar(2048) DEFAULT NULL COMMENT '状态描述',
  `EXCEPTION_INFO` varchar(1024) DEFAULT NULL COMMENT '异常信息',
  `CODE` tinyint(4) DEFAULT NULL COMMENT '编码 0:请求成功 1：请求失败',
  `ARGS` longtext COMMENT '参数',
  `USER_CODE` varchar(32) DEFAULT NULL COMMENT '员工ID-员工编号生成规则',
  `IP` varchar(1024) DEFAULT NULL COMMENT '操作人IP',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='系统操作日志表';

/*Data for the table `t_operator_log` */

