/*Table structure for table `t_role` */

DROP TABLE IF EXISTS `t_role`;

CREATE TABLE `t_role` (
  `ROLE_ID` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '角色ID',
  `ROLE_NAME` varchar(200) NOT NULL COMMENT '角色名',
  `ROLE_NAME_PINYIN` varchar(300) NOT NULL COMMENT '拼音角色名',
  `STATUS` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '可用标志',
  `CREATE_TIME` datetime NOT NULL COMMENT '创建时间',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '修改时间',
  `MEMO` varchar(1000) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`ROLE_ID`) USING BTREE,
  UNIQUE KEY `uniqueName` (`ROLE_NAME`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=42 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='角色表';

