CREATE TABLE `t_sms_msg_log` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '短信模板编号',
  `TASK_ID` int(11) NOT NULL COMMENT '订单编号',
  `USER_ID` int(11) NOT NULL COMMENT '用户主键',
  `TYPE` tinyint(4) NOT NULL COMMENT '1客户 2服务人员',
  `PHONE` varchar(11) DEFAULT NULL COMMENT '手机号码',
  `USER_NAME` varchar(16) DEFAULT NULL COMMENT '姓名',
  `SEND_TIME` datetime DEFAULT NULL COMMENT '发送时间',
  `STEP` int(11) DEFAULT NULL COMMENT '发送短信间隔时间',
  `STATUS` tinyint(1) DEFAULT NULL COMMENT '发送状态(0:成功 1:失败)',
  `ERROR` varchar(255) DEFAULT NULL COMMENT '失败原因',
  `CREATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATE_BY` int(11) DEFAULT NULL COMMENT '创建人',
  `UPDATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `UPDATE_BY` int(11) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='短信消息日志表';

