/*Table structure for table `t_task` */

DROP TABLE IF EXISTS `t_task`;

CREATE TABLE `t_task` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `ORDER_NO` varchar(64) DEFAULT NULL COMMENT '订单编号、任务编号',
  `CUSTOM_ID` int(11) DEFAULT NULL COMMENT '客户主键',
  `SERVICE_PERSON_ID` int(11) DEFAULT NULL COMMENT '服务人员主键',
  `DICT_TYPE_CODE` varchar(16) DEFAULT NULL COMMENT '字典表中的CODE编码',
  `SERVICE_CATEGORY_CODE` varchar(16) DEFAULT NULL COMMENT '服务类别SERVER_TYPE(关联t_dict表code属性 例如：A B C)',
  `SEX_REQUIRE` tinyint(4) DEFAULT NULL COMMENT '性别要求(0:不限 1:男 2:女)',
  `DISTRICT_ID` int(11) DEFAULT NULL COMMENT '所属区编号',
  `STREET_ID` int(11) DEFAULT NULL COMMENT '街区',
  `ORDER_ADDR` varchar(256) DEFAULT NULL COMMENT '预约地址',
  `ORDER_DATE` date DEFAULT NULL COMMENT '预约日期',
  `ORDER_DURATION` int(4) DEFAULT NULL COMMENT '预约订单时长',
  `ORDER_BEGIN_TIME` time DEFAULT NULL COMMENT '预约开始时间',
  `ORDER_END_TIME` time DEFAULT NULL COMMENT '预约结束时间',
  `CONTENT` text COMMENT '服务内容',
  `REMARK` varchar(1024) DEFAULT NULL COMMENT '预约备注',
  `SERVICE_BEGIN_TIME` time DEFAULT NULL COMMENT '服务开始时间',
  `SERVICE_END_TIME` time DEFAULT NULL COMMENT '服务结束时间',
  `SERVICE_DURATION` int(32) DEFAULT NULL COMMENT '服务时长',
  `SERVICE_DESC` varchar(1024) DEFAULT NULL COMMENT '服务描述',
  `ORDER_STATUS` tinyint(4) DEFAULT NULL COMMENT '订单状态(1：待分配 2:待完成 3.已完成 4.取消 5.未开始)',
  `CANCEL_RESON` varchar(1024) DEFAULT NULL COMMENT '服务取消原因',
  `CREATE_TIME` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATE_BY` int(11) NOT NULL COMMENT '创建人',
  `UPDATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `UPDATE_BY` int(11) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`ID`) USING BTREE,
  KEY `FK_订单关联客户` (`CUSTOM_ID`) USING BTREE,
  KEY `FK_订单关联服务人员` (`SERVICE_PERSON_ID`) USING BTREE,
  KEY `FK_订单关联服务类别` (`SERVICE_CATEGORY_CODE`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='订单表';

/*Data for the table `t_task` */

/*Table structure for table `t_user` */

DROP TABLE IF EXISTS `t_user`;

CREATE TABLE `t_user` (
  `USER_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户主键',
  `USER_NUMBER` varchar(16) DEFAULT NULL COMMENT '编号(客户编号、服务人员编号、后台用户编号)',
  `PASSWORD` varchar(300) DEFAULT NULL COMMENT '密码',
  `DICT_TYPE_CODE` varchar(16) DEFAULT NULL COMMENT '字典表中的CODE编码',
  `USER_TYPE` tinyint(1) DEFAULT NULL COMMENT '用户类型(1:客户 2:服务人员3:后台用户)',
  `REAL_NAME` varchar(16) DEFAULT NULL COMMENT '名称(客户名称、服务人员名称、后台用户名称)',
  `REAL_NAME_PINYIN` varchar(24) DEFAULT NULL COMMENT '拼音名称(客户名称、服务人员名称、后台用户名称)',
  `IMG` varchar(256) DEFAULT NULL COMMENT '相片地址',
  `WECHAT_NICK_NAME` varchar(32) DEFAULT NULL COMMENT '昵称',
  `OPEN_ID` varchar(32) DEFAULT NULL COMMENT '微信OPEN_ID',
  `UNION_ID` varchar(64) DEFAULT NULL COMMENT 'UNION_ID',
  `MOBILE` varchar(11) DEFAULT NULL COMMENT '手机',
  `EMAIL` varchar(128) DEFAULT NULL COMMENT '邮箱',
  `BIRTHDAY` date DEFAULT NULL COMMENT '生日',
  `PROVINCE_ID` int(11) DEFAULT NULL COMMENT '省编号',
  `CITY_ID` int(11) DEFAULT NULL COMMENT '市编号',
  `DISTRICT_ID` int(11) DEFAULT NULL COMMENT '区编号',
  `STREET_VILLAGE` varchar(64) DEFAULT NULL COMMENT '街道小区',
  `STREET_VILLAGE_PINYIN` varchar(96) DEFAULT NULL COMMENT '拼音街道小区',
  `BUILDING_NO` varchar(64) DEFAULT NULL COMMENT '楼号单元号',
  `SEX` tinyint(4) DEFAULT NULL COMMENT '性别(0:男 1:女)',
  `USER_STATUS` tinyint(4) DEFAULT NULL COMMENT '状态(0:启用 1:停用)',
  `ID_CARD` varchar(18) DEFAULT NULL COMMENT '身份证号码',
  `EMERGENCY_CONTACT_A` varchar(64) DEFAULT NULL COMMENT '紧急联系人A',
  `RELATION_WITH_A` varchar(64) DEFAULT NULL COMMENT '紧急联系人A关系',
  `EMERGENCY_CONTACT_B` varchar(64) DEFAULT NULL COMMENT '紧急联系人B',
  `RELATION_WITH_B` varchar(64) DEFAULT NULL COMMENT '紧急联系人B关系',
  `USER_LEVEL` varchar(16) DEFAULT NULL COMMENT '等级(客户、服务人员都有等级)',
  `BACK_INFO` varchar(2000) DEFAULT NULL COMMENT '背景(针对客户)',
  `REMARKS` varchar(2000) DEFAULT NULL COMMENT '备注',
  `SERVICE_CATEGORY_LEVEL` char(3) DEFAULT NULL COMMENT '服务类别等级\r\n 000:未设定\r\n 001:生活助理\r\n 010:老龄照护\r\n 100:临床护理\r\n 011:生活助理 + 老龄照护\r\n 101:生活助理 + 临床护理\r\n 110:老龄照护 + 临床护理\r\n 111:生活助理 + 老龄照护 + 临床护理',
  `DRAFT_NURSE_PLAN` tinyint(4) DEFAULT NULL COMMENT '制定照护方案(0:不可 1:可)',
  `CREATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATE_BY` int(11) DEFAULT NULL COMMENT '创建人',
  `UPDATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `UPDATE_BY` int(11) DEFAULT NULL COMMENT '更新人',
  `AGE` int(11) DEFAULT NULL,
  PRIMARY KEY (`USER_ID`) USING BTREE,
  KEY `FK_人员关联区` (`DISTRICT_ID`) USING BTREE,
  KEY `FK_人员关联市` (`CITY_ID`) USING BTREE,
  KEY `FK_用户关联省` (`PROVINCE_ID`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=85 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='人员管理表（服务人员、客户、后台用户）';

